void flash_prg_main(void)
{
#define SHOW_MSG 0

#if SHOW_MSG
    int i = 3;
    int x = 10;
#endif
    char buf[120];
    SWD_MspInit();
#if SHOW_MSG
    lcd_fill(x,32,239 - x,329 - 32,BLACK);
    lcd_show_string(x,(i++)*16,120,16,16,"init flash",WHITE);
#endif
    swd_init_debug();
    target_flash_init(Flash_Start_Addr);
#if SHOW_MSG
    lcd_show_string(x,(i++)*16,120,16,16,"eraser flash",WHITE);
#endif
    for(uint32_t addr = 0; addr < sizeof(STM32F1_demo_code); addr += 1024)
    {
        target_flash_erase_sector(0x08000000+addr);
    }
#if SHOW_MSG
    lcd_show_string(x,(i++)*16,120,16,16,"read flash",WHITE);
#endif
    for(uint32_t addr = 0; addr < sizeof(STM32F1_demo_code); addr += 1024)
    {
        swd_read_memory(0x08000000 + addr, buff, 1024);
    }
#if SHOW_MSG
    lcd_show_string(x,(i++)*16,120,16,16,"program flash",WHITE);
#endif
    for(uint32_t addr = 0; addr < sizeof(STM32F1_demo_code); addr += 1024)
    {
        target_flash_program_page(0x08000000+addr, &STM32F1_demo_code[addr], 1024);
    }
#if SHOW_MSG
    lcd_show_string(x,(i++)*16,120,16,16,"read flash",WHITE);
#endif
    for(uint32_t addr = 0; addr < sizeof(STM32F1_demo_code); addr += 1024)
    {
        swd_read_memory(0x08000000 + addr, buff, 1024);
    }
#if SHOW_MSG
    lcd_show_string(x,(i++)*16,120,16,16,"reset run",WHITE);
#endif
    swd_set_target_state_hw(RESET_RUN);
}

